import React from 'react';

const Frame130a = () => {
  return (
    <div
      style={{
        width: '1200px',
        minHeight: '360px',
        display: 'flex',
        flexDirection: 'row',
        gap: '120px',
        boxSizing: 'border-box',
        alignItems: 'center',
      }}
    >
      <img
        src="/frame130.png"
        alt="Frame130"
        style={{ height: '320px', borderRadius: '16px', background: '#fff' }}
      />
      {/* Additional Frame130a content goes here */}
      <div style={{ color: '#fff', fontSize: '32px', fontWeight: 600 }}>Frame130a Placeholder</div>
    </div>
  );
};

export default Frame130a;
